.
.

3 bunches asparagus, ends trimmed 
2 tbsps olive oil 
Salt and pepper 
300g button mushrooms, halved
 1/4 cup fresh oregano leaves
1/ 4 cup fresh thyme leaves 
1 large lemon, zested and juiced 
Preheat the oven to 230Â°C (450Â°F, Gas Mark 8). Line a large baking tray with baking paper. 
Toss the asparagus and mushrooms with the oil and a couple of grinds of salt and pepper. Spread over a large baking tray in a single layer. 
Roast for 15 minutes until the mushrooms are browned and the asparagus is cooked through. 
Remove from the oven and gently toss the herbs, lemon zest and juice through the vegetables. 
Season further to taste and serve warm and with parmesan grated cheese.

